import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

let dialogItemsData = [
    {name: 'Henry Dinn' , id: 1 },
    {name: 'Michael Ross' , id: 2 },
    {name: 'Dick Irvin' , id: 3 },
    {name: 'Dafna Grass' , id: 4 }
]
let messagesData = [
    {message: 'Hey,how are you?', id: 1},
    {message: 'Great! How are you?', id: 2},
    {message: 'Im fine! Go work!', id: 3},
    {message: 'Lets go!!!', id: 4},
]

ReactDOM.render(<App dialogItemsData = {dialogItemsData} messagesData={messagesData} />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
